import React from "react";
import { useParams } from "react-router-dom";
import { useQuery, gql } from "@apollo/client";

const GET_USER_BYID = gql`
  query User($userId: ID!) {
    user(id: $userId) {
      name
    }
  }
`;
function User() {
  const id = useParams().id;

  return <div>User {id}</div>;
}

export default User;
